import React from "react";
function Header(){

    return(
        <header>
            <a href="#">Observatorio  Online</a>
            <div className="HbarraPesquiza">
            <input type="text"/><button onClick="">Search</button>
            </div>
            <p><a href="#">Sobre</a></p>
            <p><a href="#">Cadastrar</a></p>
            <p><a href="#">Login</a></p>
        </header>
    )
}

export default Header
